import React, { Component } from "react"

import Row from "phoenix-ui/lib/grid/Row"
import Col from "phoenix-ui/lib/grid/Col"
import Input from "phoenix-ui/lib/input"
import Button from "phoenix-ui/lib/button"
import List from "phoenix-ui/lib/list"
import Animate from "phoenix-ui/lib/animate"
import Code from "./code/code"

export default class animate extends Component{

    constructor(props,context){
        super(props,context); 

        this.state = {
            list: ["", "8"]
        }
    }

    addTodo(){
        let newList = this.state.list.concat(this.input.getValueCallback())

        this.setState({
            list: newList
        })
    }

    removeTodo(index){
        let newList = this.state.list.slice()

        newList.splice(index,1)

        this.setState({
            list: newList
        })
    }

    renderList(){
        const items = this.state.list.map((item,index)=>{
            return (
                <List.Item key={index} className="animated" onClick={this.removeTodo.bind(this,index).bind(this)}>
                    <List.Col>{item}</List.Col>
                </List.Item>
            )
        })
        return items
    }

    render(){

        return(
            <div>
                <h2 className="comp-title">Animate</h2>
                <h3 className="comp-type">Todo demo</h3>
                <div className="content ph-row-no-padding todo-demo">
                    <Row>
                        <Col width="80">
                            <Input type="text" ref={(input)=>{this.input=input}}/>
                        </Col>
                        <Col>
                            <Button phStyle="primary" onClick={this.addTodo.bind(this)} >Add</Button>
                        </Col>
                    </Row>
                </div>
                <List>
                    <Animate transitionName="fade" className="animate-field">
                        {this.renderList()}
                    </Animate>
                </List>
                <Code target="animate" />             
            </div>
        )
    }
}

import React, { Component } from "react"

import Checkbox from "phoenix-ui/lib/checkbox"
import Button from "phoenix-ui/lib/button"
import Code from "./code/code"

export default class input extends Component{

    constructor(props,context){

        super(props,context);

        this.state = {
            checkboxChecked: true
        };
    }

    onCheckboxChange(){
        this.setState({
            checkboxChecked: !this.state.checkboxChecked
        });
    }

    render(){
        return(
            <div>
                <h2 className="comp-title">Checkbox</h2>
                <h3 className="comp-type">defaultChecked </h3>
                <div className="content">
                    <Checkbox label="" defaultChecked={true} />
                </div>
                <Code target="checkbox-default" />

                <h3 className="comp-type">checkedonChange</h3>
                <div className="content">
                    <Checkbox label="" checked={this.state.checkboxChecked} onChange={::this.onCheckboxChange} />
                </div>
                <Code target="checkbox-onchange" />

                <h3 className="comp-type">disabled</h3>
                <div className="content">
                    <Checkbox label="" disabled/>
                </div>
                <Code target="checkbox-disabled" />
            </div>
        );
    }
}

import React, { Component } from "react"

import Drag from "phoenix-ui/lib/drag"
import Code from "./code/code"

export default class toast extends Component{

    constructor(props,context){
        super(props,context); 

        this.preDistanceX = 0;
        this.preDistanceY = 0;
        this.distanceX = 0;
        this.distanceY = 0;
    }

    dragCallback(event,position){
        this.prePosition = position.start;
        this.nowPosition = position.move;

        this.distanceX = this.preDistanceX + this.nowPosition.x - this.prePosition.x;
        this.distanceY = this.preDistanceY + this.nowPosition.y - this.prePosition.y;

        this.setBoxPosition(this.distanceX, this.distanceY);
    }

    dropCallback(event,position){
        this.preDistanceX = this.distanceX;
        this.preDistanceY = this.distanceY;
    }

    setBoxPosition(x,y){
        this.box.style.webkitTransform = "translate("+x+"px,"+y+"px)";
        this.box.style.transform = "translate("+x+"px,"+y+"px)";
    }

    render(){
        return(
            <div>
                <h2 className="comp-title">Drag</h2>
                <h3 className="comp-type">Dragable Box demo</h3>
                <Code target="drag" />
                <div className="content-drag">
                    <Drag dragCallback={this.dragCallback.bind(this)} dropCallback={this.dropCallback.bind(this)} style={{height:0}}>
                        <div className="box" ref={(box)=>{this.box = box}}>Drag</div>
                    </Drag>
                </div>
            </div>
        );
    }
}

