import React, { Component } from "react"

import PullUp from "phoenix-ui/lib/pullup"
import List from "phoenix-ui/lib/list"

import Code from "./code/code"
import {ajax} from "./utils/tool.js"

export default class pullup extends Component{
    constructor(props,context){
        super(props,context); 

        this.count = 0;

        this.state = {
            loadingData : [],
            status: 1, // 0"",1"",2"",3"",4""
            visible1: false,
        }

        this.loadCallback();
    }

    // ()
    loadCallback(){
        this.getData("./data/post"+(this.count?this.count:'')+".json") // 
        this.count++
    }

    getData(fileName){ // ajax
        ajax(fileName).then((json)=>{
            // 
            let data = json.data;
            let loadingData = this.state.loadingData.slice(0);
            for(let i in data){
                loadingData.push(data[i]);
            }

            this.setState({
                loadingData: loadingData,
                status: json.final? 4:2 // final
            }); 

        }, (error)=>{
            // 
            this.setState({
                status: 3
            })
        });
    }

    render(){
        return(
            <div>
                <h2 className="comp-title">PullUp</h2>
                <h3 className="comp-type">mode(auto) ()</h3>
                <h3 className="comp-type">status (0, 1, 2, 3, 4)</h3>
                <h3 className="comp-type">tips </h3>
                <h3 className="comp-type">phStyle(primary) </h3>
                <h3 className="comp-type">loadCallback </h3>
                <div>
                    <List>
                        <List.Header></List.Header>
                        {
                            this.state.loadingData.map((item,index)=>{
                                return (
                                    <List.Item key={index}>
                                        <List.Col>{item.title}</List.Col>
                                    </List.Item>
                                )
                            })
                        }
                    </List>
                    <PullUp status={this.state.status} loadCallback={this.loadCallback.bind(this)} />
                </div>            	
            </div>
        );
    }
}

